		function createBats() { //פונקציית האינטרוול שיוצרת את הפתקים והעטלפים
			if (isPaused == false) { //אם המשחק לא נעצר
				if (progressCounter == myResult[1].length) { //אם נגמר המשחק
					tickerStatus = true; //עצירת הטיקר
					startTime = false; //עצירת ספירת הזמן
					beforeFinish(); //הפעלת המשוב לניצחון בו המכשפה חוזרת לטירה
		
				} else { //אם לא נגמר המשחק
		
					createNotes(); //יצירת פתקים
					itemContentRoll(); //בדיקה כמה נשארו מכל מערך והגרלה מתאימה של פתק
					// הוספת הפתק החדש למערך הפתקים שבהמשך לולאה עוברת עליו ומייצרת על הבמה
					batsArr[batsArr.length] = new Array(note.name, myGame[rndTrueFalse][rndOption][0], rndTrueFalse, rndOption);
					note_names[note_names.length] = note.name; //מערך של שמות הפ
					if (myGame[rndTrueFalse][rndOption][1] == "TXT") { //אם מדובר בתוכן שהוא טקסט
						//כל ההגדרות שנוגעות לטקסט בתוך הפתק
						myTxt = new createjs.Text();
						myTxt.font = "19pt 'Varela Round'";
						myTxt.textBaseline = "middle";
						myTxt.lineWidth = 100; //הגדרת שבירת שורה
						myTxt.text = myGame[rndTrueFalse][rndOption][0]; //השמת הטקסט כפי שמופיע בתא הראשון במערך בפריט שהוגרל
						myTxt.rotation = -20;
						myTxt.textAlign = "center";
						myTxt.name = "txt" + note.name;
						if (myGame[rndTrueFalse][rndOption][0].length > 20) { //אם יש יותר מ 25 תווים לבצע יישור לימין
							myTxt.font = "17pt 'Varela Round'";
							myTxt.x = -20;
							myTxt.y = -40;
							myTxt.lineWidth = 120; //הגדרת שבירת שורה
						}
					
						note.addChild(myTxt);
					}else if (myGame[rndTrueFalse][rndOption][1] == "PIC") { //אם מדובר בתוכן שהוא תמונה
						//יצירת אובייקט תמונה
						baseGameObjectIndex = findIndexInGameBase(myGame[rndTrueFalse][rndOption][0], rndTrueFalse);
						baseGameObject = baseGamePointer[rndTrueFalse][baseGameObjectIndex];
						myImgObj = baseGameObject[2];
						var scalex = 1
						var scaley = 1
						var myPic = new createjs.Bitmap(myImgObj);
						var picH = myPic.getBounds().height;
					    var picW = myPic.getBounds().width;
						if ( picW > 120 || picH > 180)
						{ 
							if (picW >= picH)
							{ 
							scalex = myPic.scaleX / (picW/120) //it was 120
							scaley = scalex
							}
							
						    if (picH > picW)
							{ 
							scaley = myPic.scaleY / (picH/130)//it was 150
							scalex = scaley
							//	myPic.y=-55;
							}
					}
						//myPic.setTransform(-96 + ((182-1.06*(picW * scalex))/2),0, scalex, scaley, -21)
						myPic.x= -96 + ((182-1.06*(picW * scalex))/2);
					//	myPic.y= 0
						myPic.scaleX=scalex;
						myPic.scaleY=scaley;
						myPic.rotation=-21;
					   // myPic.x = -62;
						//myPic.y = -46
				       // myPic.x =(-93-picW/postScaleX)/2;
						if(picH >= picW){
							myPic.y=-40
							myPic.x=myPic.x-15;
							}
						note.addChild(myPic);
					}}
					batCounter++; //העלאת משתנה ספירת העטלפים
					//tickerStatus = 2;
				}
			}
		
		
