		//פונקציית בדיקת מגע בין העטלפים עם הפתקים למכשפה
		function checkForCollision(witch, approachingNote, number) {
			var batArrayIndex = note_names.indexOf("note" + number); //האינדקס במערך המשחק
			var answer_type = batsArr[batArrayIndex][2] // התא במערך המשחק- אפס או אחד
			var noteText = batsArr[batArrayIndex][1]; //הטקסט של התא 
			var indexInGame = findIndexInArray(noteText, answer_type, myGame); //בדיקת האינדקס במערך המקורי
		
			if (indexInGame == -1) { //אם התבצע מגע ניתן לצאת מהפונקציה
				return;
			}
			var aroundWitch = witch.nominalBounds; //יצירת גבולות למכשפה
			var aroundNote = approachingNote.nominalBounds; // יצירת גבולות לעטלפים
			var myResultIndex = findIndexInMyResult(myGame[answer_type][indexInGame][0], answer_type); //אינדקס במערך התוצאות
		
			if (myResultIndex == -1) {
				return;
			}
		
			if (witch.x + (aroundWitch.width / 2) - (approachingNote.x - aroundNote.width / 2 + 5) >= 0 && // התניית מגע
				(witch.y > approachingNote.y - aroundNote.height / 2 && witch.y < approachingNote.y + aroundNote.height / 2)) {
				touched = true;
		
			}
			if (touched) {
				if (answer_type == 1) { // מגע בתשובה נכונה
					if (myResult[answer_type][myResultIndex][2] == 0) {
						myResult[answer_type][myResultIndex][2] = "2";
					}
					//console.log("נגעתי בתשובה נכונה");
					myRightMusic = createjs.Sound.play("right");
					stage.getChildByName("myWitch" + 2).face.gotoAndPlay(1);
					progressCounter++;
					if (progressCounter < 10 && progressCounter != 0) {
						progress.correct.text = "0" + progressCounter; //מד התקדמות	
					} else {
						progress.correct.text = progressCounter; //מד התקדמות		
					}
					var noteX = approachingNote.x;
					var noteY = approachingNote.y;
					success = new lib.success();
					stage.addChild(success);
					success.x = noteX;
					success.y = noteY;
					stage.removeChild(approachingNote);
					if (success.y == 600) {
						success.gotoAndPlay(0);
					}
					if (success.y == 450) {
						success.gotoAndPlay(30);
					}
					if (success.y == 280) {
						success.gotoAndPlay(60);
					}
					note_names[(note_names.indexOf("note" + number))] = "0";
		
					myGame[answer_type].splice(indexInGame, 1);
					//removeRightNotes(number, answer_type, bat_num);
					//אם התשובה לא נכונה להשהות את המשחק
		
				} else { //מגע בתשובה לא נכונה
					if (myResult[answer_type][myResultIndex][2] == 0) // אם זו פעה ראשונה
					{
						//console.log("נגעתי בתשובה שגויה");
						myResult[answer_type][myResultIndex][2] = "4"; //תעדכן את הסטטוס ל4
					}
					myWrongMusic = createjs.Sound.play("wrong"); //תבצע משוב שנית
					stage.getChildByName("myWitch" + 2).face.gotoAndPlay(40);
		
					approachingNote.gotoAndStop(9)
					batsArr[batArrayIndex][1] = "NotInMyGameForSure";
				}
		
			} else { //אם לא נגעתי
				if (answer_type == 0) { //והתשובה שגויה
		
					if (myResult[answer_type][myResultIndex][2] == 0) { //אם זו פעם ראשונה
						//console.log("התעלמתי מתשובה שגויה");
						myResult[answer_type][myResultIndex][2] = "1"; //שינוי הסטטוס
					}
					myGame[answer_type].splice(indexInGame, 1);
				} else { //אם לא נגעתי והתשובה נכונה
					if (myResult[answer_type][myResultIndex][2] == 0) {
						//console.log("התעלמתי מתשובה נכונה")
						myResult[answer_type][myResultIndex][2] = "3"; //שינוי הסטטוס
					}
				}
			}
			touched = false;
		console.log(myResult);
		}
		
		
